webpackJsonp([0xaf09bebf706a],{2943:function(a,e){a.exports={pathContext:{docHtml:'<h1>HAR Validator <a href="https://www.npmjs.com/package/har-validator"><img src="https://img.shields.io/npm/v/har-validator.svg?style=flat-square" alt="version"></a> <a href="http://choosealicense.com/licenses/isc/"><img src="https://img.shields.io/npm/l/har-validator.svg?style=flat-square" alt="License"></a></h1>\n<blockquote>\n<p>Extremely fast HTTP Archive (<a href="https://github.com/ahmadnassri/har-spec/blob/master/versions/1.2.md">HAR</a>) validator using JSON Schema.</p>\n</blockquote>\n<p><a href="https://travis-ci.org/ahmadnassri/har-validator"><img src="https://img.shields.io/travis/ahmadnassri/har-validator.svg?style=flat-square" alt="Build Status"></a>\n<a href="https://www.npmjs.com/package/har-validator"><img src="https://img.shields.io/npm/dm/har-validator.svg?style=flat-square" alt="Downloads"></a>\n<a href="https://codeclimate.com/github/ahmadnassri/har-validator"><img src="https://img.shields.io/codeclimate/github/ahmadnassri/har-validator.svg?style=flat-square" alt="Code Climate"></a>\n<a href="https://codeclimate.com/github/ahmadnassri/har-validator"><img src="https://img.shields.io/codeclimate/coverage/github/ahmadnassri/har-validator.svg?style=flat-square" alt="Coverage Status"></a>\n<a href="https://dependencyci.com/github/ahmadnassri/har-validator"><img src="https://dependencyci.com/github/ahmadnassri/har-validator/badge?style=flat-square" alt="Dependency Status"></a>\n<a href="https://david-dm.org/ahmadnassri/har-validator"><img src="https://img.shields.io/david/ahmadnassri/har-validator.svg?style=flat-square" alt="Dependencies"></a></p>\n<h2>Install</h2>\n<pre><code class="language-bash">npm install --only=production --save har-validator\n</code></pre>\n<h2>Usage</h2>\n<p>I recommend using an optimized build matching your Node.js environment version, otherwise, the standard <code>require</code> would work just fine with any version of Node <code>>= v4.0</code> .</p>\n<pre><code class="language-js">/*\n * Node 7\n */\nconst validate = require(\'har-validator/lib/node7\')\n\n/*\n * Node 6\n */\nconst validate = require(\'har-validator/lib/node6\')\n\n/*\n * Node 4 (Default)\n */\nvar validate = require(\'har-validator\')\n</code></pre>\n<h2>CLI Usage</h2>\n<p>Please refer to <a href="https://github.com/ahmadnassri/har-cli"><code>har-cli</code></a> for more info.</p>\n<h2>API</h2>\n<p><strong>Note</strong>: as of <a href="https://github.com/ahmadnassri/har-validator/releases/tag/v2.0.0"><code>v2.0.0</code></a> this module defaults to Promise based API. <em>For backward comptability with <code>v1.x</code> an <a href="docs/async.html">async/callback API</a> is also provided</em></p>\n<ul>\n<li><a href="docs/async.html">async API</a></li>\n<li><a href="docs/async.html">callback API</a></li>\n<li><a href="docs/promise.html">Promise API</a> <em>(default)</em></li>\n</ul>\n<hr>\n<blockquote>\n<p>:copyright: <a href="https://www.ahmadnassri.com/">ahmadnassri.com</a>  · \nLicense: <a href="http://choosealicense.com/licenses/isc/">ISC</a>  · \nGithub: <a href="https://github.com/ahmadnassri">@ahmadnassri</a>  · \nTwitter: <a href="https://twitter.com/ahmadnassri">@ahmadnassri</a></p>\n</blockquote>',docPath:"argo-ci/node_modules/node-pre-gyp/node_modules/har-validator/readme",proj:"argo-ci"}}}});
